import React from 'react';
import InputNumber from './InputNumber';
import InputSelect from './InputSelect';
import InputText from './InputText';
import InputTextArea from './InputTextArea';
import InputCheckbox from './InputCheckbox';

class Form extends React.Component {
  render() {
    return (
      <main>
        <InputText data-testid="name-input" />
        <InputTextArea data-testid="description-input" />
        <InputNumber data-testid="attr1-input" />
        <InputNumber data-testid="attr2-input" />
        <InputNumber data-testid="attr3-input" />
        <InputText data-testid="image-input" />
        <InputSelect data-testid="rare-input" />
        <InputCheckbox data-testid="trunfo-input"/>
      </main>
    );
  }
}

export default Form;
